import React from "react";
 function Navi(){
    return(
    <>
    <div style={navi}>
        <ul>
            <li>Home</li>
            <li>About</li>
            <li>Services</li>
            <li>goals</li>
            <li>Achivemts</li>
           
        </ul>
    </div>      
</>
    );
 }

 let navi={
    border:"5px solid green",
    color:"red",
    hight:"100px",
    width:"100%",
    display:"inlineBlock",
    justifyContent:"center",
    textAlign:"center"
    // alignContent:"center",

 }

 




export default Navi;
